DROP TABLE IF EXISTS `log_subscribe`;
CREATE TABLE `log_subscribe` (
  `subscribe_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `recurring_payment_ack` varchar(20) NOT NULL COMMENT 'Acknowledge from PayPal Recurring Payments API cal',
  `log_date` datetime NOT NULL COMMENT 'Date this log_subscribe record as created',
  `vendor_id` int(8) NOT NULL COMMENT 'From the FarmMade `vendor` database table',
  `subscribe_mode` varchar(60) NOT NULL COMMENT 'One of six PayPal Recurring Payments (Subscribe) payment workflow modes',
  `seller_shop_name` varchar(255) NOT NULL COMMENT 'FarmMade Seller shop name is unique',
  `seller_name` varchar(60) NOT NULL COMMENT 'First name from FarmMade Seller registration',
  `seller_paypal_address` varchar(128) NOT NULL,
  `seller_PP_PayerID` varchar(15) NOT NULL COMMENT 'PayPal PayerID, which a unique identifier related to a PayPal email address',
  `seller_PP_ProfileID` varchar(20) NOT NULL COMMENT 'PayPal Recurring Payments (Subscribe) ProfileID for the FarmMade shop',
  `seller_PP_PayerEmail` varchar(128) NOT NULL COMMENT 'PayPal Subscribe email address, linked to the PayerID. Can be different from the vendor_paypal_address',
  `seller_PP_ProfileStatus` varchar(12) NOT NULL COMMENT 'PayPal Recurring Payments (Subscribe) ProfileStatus of Active, Pending, Cancelled, Suspended, or Expired',
  `seller_PP_ProfileStartDate` datetime NOT NULL COMMENT 'PayPal Recurring Payments (Subscribe) anniversary date. PayPal monthly subscribe will occur on this date each month after the 60-day trial',
  `seller_PP_PayerCountry` varchar(6) NOT NULL DEFAULT '' COMMENT 'PayPal Recurring Payments (Subscribe) two digit country code.',
  `version` varchar(20) NOT NULL,
  `build` varchar(20) NOT NULL,
  `correlationId` varchar(20) NOT NULL,
  `timestmp` datetime NOT NULL,
  PRIMARY KEY (`subscribe_id`),
  KEY `seller_shop_name` (`seller_shop_name`),
  KEY `vendor_id` (`vendor_id`)
) ENGINE=InnoDB AUTO_INCREMENT=461 DEFAULT CHARSET=utf8;

